select * from HW_Flight_List_T;
drop table HW_Flight_List_T;


use HW_Airports;
CREATE TABLE HW_Flight_List_T (
    flightID INT PRIMARY KEY AUTO_INCREMENT,
    departure VARCHAR(3) NOT NULL,
    arrival VARCHAR(3) NOT NULL,
    price DECIMAL(10, 2) NOT NULL,
    availableSeats INT NOT NULL,
    departureTime DATETIME NOT NULL,
    arrivalTime DATETIME NOT NULL,
    duration TIME NOT NULL
);



SELECT * FROM HW_Flight_List_T;
SELECT flightID, departure, arrival, price, availableSeats FROM HW_Flight_List_T WHERE departure = 'SAN' AND arrival = 'DTW';



